  `transaction_id` bigint unsigned NOT NULL,
  `account_id` bigint unsigned NOT NULL,
  `debit` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT 'Ná»£ (Debit) - TÄng tÃ i sáº£n/chi phÃ­, giáº£m ná»£/doanh thu',
